import React, { useEffect, useState } from 'react'
import axios from 'axios'
import './ViewClosed.css'
import * as ReactBootStrap from 'react-bootstrap';
export default function ViewClosed() {
    const [tickets ,setTickets]=useState([])
    const [details, setDetail]= useState([])
    useEffect(() => {
        axios.get('http://localhost:8080/bus/ticket/viewClosed').then((res) => {   
          
                console.log({...res.data});
               
                setTickets({...res.data});
                console.log(tickets)
                return(
                    <tr className="btn btn-info " key={tickets} > 
                             <td style={{backgroundColor:"darkblue", borderColor:"darkblue",width:"40px"}}>{tickets.seatID}</td>
                       
                       </tr>
                )
        })
       
    },[tickets])
    

    const handleSubmitDetails = (ticket,index) => {
        return(
            <tr className="btn btn-info " key={index} > 
                     <td style={{backgroundColor:"darkblue", borderColor:"darkblue",width:"40px"}}>{ticket.seatID}</td>
               
               </tr>
        )
    
       
                      
            }
    return (
        <div className="ss">
            <div className="row">
                <div className="columna">
                    <div className="plane">
                        {/* <form >
                           
                        </form> */}
                    </div>
                </div>
                <div className="column2">
                    <div className="seatInfo">
                        
                        <div>
                            <a href="/Admin/pass">
                               
                            <button  onClick={useEffect} style={{marginLeft: "0px",width:"100%",height:"60px"}} className="btn btn-info seatBT">
                              View Closed Tickets
                             
                            </button>
                            </a>
                            
                           </div>
                       <ReactBootStrap.Table  >
                              <br></br> 
                             
                            <tbody class="info"> <span class="extra-info">                         
                        {/* <ul >
                            <li>Name:{details.name}</li>
                            <li>Age : { details.age}</li>
                            <li>Email ID:{ details.email}</li>
                        </ul>    */}
                            </span>
                            
                            </tbody>
                             </ReactBootStrap.Table>
                            
                         </div>
                    </div>
              
            </div>
        </div>
    );
}
